defs.script:

var indicator = d3.select('#indicator');
var p = d3.select('#indicator')

function Update(inputObject){
  for(let i = 0; i < Object.keys(inputObject).length; i++){
    let key = Object.keys(inputObject)[i];
    let value = Object.values(inputObject)[i];
    switch (key) {

      case 'alt':
        //console.log('vertical speed is '+value+' ft/min.');
        value = value / 100;
        d3.select('#indicator')
          .attr('transform', 'rotate('+value+', 50, 50 )')
        break;

      case 'test':
        d3.select('#indicator')
          .attr('transform', 'rotate('+value.x+', 50, 50 )')
        break;

      default:
        //console.log('       :-(    Attribute '+key+' not relevant for this element... Ignoring');
    };
  }
}

window.onload = setTimeout(function(){
  var socket = io.connect();
  socket.on('chat', function (data) {
    Update(data);
  });
}, 50);
